          <News_Events />
        </section>
        <section id="aboutus" className="h-auto">
          <AboutUs />
        </section>
        <section id="contactus" className="lg:h-[300px] h-auto">
          <ContactUs />
        </section>
      </main>



      <footer class="flex w-full h-[30px] bg-gray-800">
        <p class="h-full mx-auto text-left text-white text-xs">
